import logo from '../../peach.png';
import TodoForm from './components/Todo/TodoForm'

function Navbar() {
  return (
    <nav className="Navbar">
      <img src={logo} className="App-logo" alt="logo" />
      <p>
        What I gotta do.
      </p>
      <TodoForm/>
    </nav>
  );
}

export default TodoForm;
